section {
  padding: 0 1em 0 1em;
}

.container {
  margin-top: 1em;
}

.addNewToDo input {
  font-size: 1em;
  font-family: sans-serif;
  width: 100%;
  padding: 1em;
  border: solid 2px #999;
}
.addNewToDo input:focus {
  border-color: #2787B0;
}

.todos ul {
  list-style: none;
  margin: 0;
  padding: 0;
}
.todos ul li {
  margin: 0;
  padding: 1em;
  width: 100%;
  border-bottom: solid 2px #999;
  background: #E8A8A8;
  -webkit-transition: background-color ease 600ms;
  -o-transition: background-color ease 600ms;
  transition: background-color ease 600ms;
  position: relative;
}
.todos ul li .statusIcon {
  position: absolute;
  left: 1em;
  top: 14px;
}
.todos ul li .deleteIcon {
  position: absolute;
  right: 1em;
  top: 14px;
}
.todos ul li.done {
  background: #7FC7A1;
}
.todos ul li span {
  display: block;
  cursor: pointer;
  padding: 0 4em 0 4em;
  text-align: center;
}
.todos ul li span input {
  width: 80%;
  padding: 0.5em;
}
.todos ul li a, .todos ul li label {
  cursor: pointer;
}
.todos ul li label input {
  display: inline-block;
  margin-right: 1em;
}

